import React, {useState} from 'react';
import ReactMapGL from "react-map-gl"

function Park() {
const [viewport] = useState({
    latitude: 39.9629,
    longitude: 75.1806,
    width: "100vw",
    height: "100vh",
    zoom: 10
});
require("dotenv").config()
 return ( 
     <div>
         <ReactMapGL
         {...viewport}
         mapboxApiAccessToken = {
             process.env.REACT_APP_MAPBOX_TOKEN
         }
         >
    
         </ReactMapGL>
     </div>
 );
}

export default Park;
